<main class="cards">

    <section class="card card-rojo">
        <h2>Uso del Casco</h2>
        <p>El uso del casco es obligatorio tanto para el conductor como para el acompañante.</p>
        <img src="data:image/jpeg;base64," alt="Casco">
    </section>

    <section class="card card-azul">
        <h2>Licencia de Conducir</h2>
        <p>Es obligatorio contar con una licencia válida para la motocicleta.</p>
        <img src="data:image/jpeg;base64," alt="Licencia">
    </section>

    <section class="card card-verde">
        <h2>Velocidad Permitida</h2>
        <p>Respetar los límites de velocidad evita accidentes.</p>
        <img src="data:image/jpeg;base64," alt="Velocidad">
    </section>

    <section class="card card-naranja">
        <h2>Elementos de Seguridad</h2>
        <ul>
            <li>Casco</li>
            <li>Guantes</li>
            <li>Chaqueta</li>
            <li>Luces encendidas</li>
        </ul>
        <img src="data:image/jpeg;base64," alt="Seguridad">
    </section>

    <section class="card card-morado">
        <h2>Señales de Tránsito</h2>
        <p>Respetar señales y semáforos es fundamental.</p>
        <img src="data:image/png;base64," alt="Señales">
    </section>

    <section class="card card-amarillo">
        <h2>No Usar el Celular</h2>
        <p>
            Está prohibido el uso del teléfono móvil mientras se conduce,
            ya que distrae y aumenta el riesgo de accidentes.
        </p>
        <img src="data:image/png;base64," alt="Uso del celular">
    </section>
    
    <section class="card card-celeste">
        <h2>Transporte de Acompañante</h2>
        <p>
            Solo se permite llevar un acompañante si la motocicleta está
            diseñada para ello y ambos usan casco.
        </p>
        <img src="data:image/jpeg;base64," alt="Acompañante en moto">
    </section>
    
    <section class="card card-negro">
        <h2>Documentación al Día</h2>
        <p>
            Es obligatorio portar SOAT, tarjeta de propiedad y revisión
            técnico-mecánica vigentes.
        </p>
        <img src="data:image/png;base64," alt="Documentos de la moto">
    </section>    

</main>

